    public function getSourceContext()
    {
        return new Source("{% extends 'knp_menu.html.twig' %}

{% block root %}
    <div class=\"ui fluid vertical menu\">
        <div class=\"header item\">{{ item.label|trans }}</div>
        {{ block('list') }}
    </div>
{% endblock %}

{% block list %}
    {% for item in item.children %}
        {{ block('item') }}
    {% endfor %}
{% endblock %}

{% block item %}
    <a class=\"item\" href=\"{{ item.uri }}\">
        {{ block('icon') }}
        {{ item.label|trans }}
    </a>
{% endblock %}

{% block icon %}
    {% set icon = item.labelAttribute('icon') %}
    {% if icon %}<i class=\"icon {{ icon }}\"></i> {% endif %}
{% endblock %}
", "@SyliusUi/Menu/simple.html.twig", "/var/www/html/Sylius/src/Sylius/Bundle/UiBundle/Resources/views/Menu/simple.html.twig");
